const html = $input.first().json.html;
const root = "https://ajuda.blips.com.br/";
const uploads = "wp-content/uploads";

// Regexes originais
const attributeRegex = /\s(?:class|data-settings|data-e-action-hash|data-width|data-height|aria-label)="[^"]*"/gi;
const galleryrgx = /class="e-gallery[^"]*"/gi;
const pathrgx = /<path[^>]*>.*?<\/path>/gis;
const stylergx = /<style>\/\*! elementor[\s\S]*?<\/style>/gi;
const svgRegex = /<svg[\s\S]*?<\/svg>/gi;
const divClassRegex = /<div\s+[^>]*class\s*=\s*["'][^"']*["'][^>]*>/gi;

// NOVO: Remove todos os data-elementor-* seguidos até o title= (mantém só title="...")
const dataAndTitleGroup = /(data-elementor-[^=]+="[^"]*"\s*)+title="([^"]*)"/gi;

function sanitizeHtml(html) {
  return {
    html: "<root> = " + root + "<uploads> = " + uploads + " "
      + html
        .replace(stylergx,"")
        .replace(dataAndTitleGroup, 'title="$2"')     // REMOVE todos data-elementor... até title, mantém title
        .replace(attributeRegex,"")                   
        .replace(galleryrgx,'class="img-item"')       
        .replace(pathrgx,"")                          
        .replace(svgRegex,"")                         
        .replace(divClassRegex,"<div>")               
        .replaceAll(root,"<root>")                    
        .replaceAll(uploads,"<uploads>")              
  };
}

return sanitizeHtml(html);
